import React from "react";
import { NavLink } from 'react-router-dom';
import web from '../src/Images/side.jpg';
import br from '../src/Images/title.jpg';



const Home = () =>{

    return (
        <>
        <div className="head">
        <img  src={br} alt="nn" />
        </div>
        <section>
            <div className="content">
            <h2>Welcome!</h2>
             <p>Here iam provided projects done by my self</p>
             <div className="project_style">
                <ul>
                    <li><NavLink exact activeClassName='active_class' to= '/todolist'>Todolist</NavLink></li>
                   <li> <NavLink exact activeClassName='active_class' to='/acordion' >accordionproject</NavLink></li>
                </ul>
                <img src={web} alt="imh" />
                
                
             </div>




                <label> </label>
            </div>
        </section>
        
        </>
    )
}
export default Home;
